import styled from 'styled-components';

const Logo = () => {
    const Logo = styled.span`
    font-family: 'Monofett', cursive;
    font-size:36px;
    text-align:center;
    color: var(--primary);
    `
    return <Logo>
        Jobify
    </Logo>
}

export default Logo
